%[text] # calculate optimal Fisher Information for a certain tumour position
% clc
% clear

addpath(genpath('D:\zhiguan_wang\OneDrive - University of Glasgow\project in UK 2024\tomography241015\NIRfast_code_241118\NIRFAST-9.1'));
addpath(genpath('D:\zhiguan_wang\OneDrive - University of Glasgow\project in UK 2024\tomography241015\NIRfast_code_241118\nirfast_fisher_numerical_311224'))
% addpath(genpath('F:\OneDrive - University of Glasgow\project in UK 2024\tomography241015\NIRfast_code_241118\NIRFAST-9.1'));
% addpath(genpath('F:\OneDrive - University of Glasgow\project in UK 2024\tomography241015\NIRfast_code_241118\nirfast_fisher_numerical_311224'))
mua_value = 0.033; % 0.01
mus_value = 1;

tumour_pos = [38,0];
tumour_radius = 15;

base_radius = 54;

dense_dist = 0.5;
base_dist = 1;

circle_mesh = gen_nonuni_circle_mesh(tumour_pos,max(tumour_radius)+2*dense_dist,dense_dist,base_radius,base_dist,mua_value,mus_value,1.33); %[output:60747fa9] %[output:47d808ec]
d_mua = 0.02;
%%
data_size = 9;
source_radius = base_radius-0.01; source_angle_rad = linspace(-pi/2,0,ceil(data_size/2))';
% source_radius = base_radius-0.01; source_angle_rad = pi/8;
src_pos = [source_radius*cos(source_angle_rad),source_radius*sin(source_angle_rad)];
mea_radius = base_radius-0.01; mea_angle_rad = linspace(-pi/2,pi/2,data_size)';
% mea_radius = base_radius-0.01; mea_angle_rad = -pi/8;
mea_pos = [mea_radius*cos(mea_angle_rad),mea_radius*sin(mea_angle_rad)];

mesh_for_plot = circle_mesh;
mesh_for_plot.source.coord = src_pos;
mesh_for_plot.meas.coord = mea_pos;
figure;plot_src_meas(mesh_for_plot); %[output:31fde8c7]
title('all S-D positions') %[output:31fde8c7]
ax = gca; ax.FontSize = 20; %[output:31fde8c7]
clear mesh_for_plot
%%
%[text] ## calculate fisher batch
mesh = circle_mesh; % initialize the mesh
tumour_position = tumour_pos; % Set the tumour position for calculations

mesh.source.distributed = 0;    % sources are not distributed
mesh.source.fixed = 1;          % source are fixed
mesh.source.num = 1;
mesh.source.fwhm = zeros(mesh.source.num);
mesh.link = [1 1 1];
mesh.meas.fixed = 1;            % meas are fixed
mesh.meas.num = 1;
mesh_ori = mesh;
size_k = length(tumour_radius);
numIterations = size(src_pos,1)*size(mea_pos,1);

% % % % pare the data
amplitude = zeros(size(src_pos,1)*size(mea_pos,1),length(tumour_radius));
amplitude_p = zeros(size(src_pos,1)*size(mea_pos,1),length(tumour_radius));
distance2tumour = sqrt((mesh.nodes(:,1)-tumour_position(1)).^2+(mesh.nodes(:,2)-tumour_position(2)).^2);

% % % % discrete the radius
% % % % minimum radius difference is 0.31 mm
% % % % nonuni range is 1:max(tumour_radius)+1
radiusEdge = (0:dense_dist:max(tumour_radius)+1)';

parfor_progress(numIterations); % Initialize programss bar %[output:139830b6]
parfor (i = 1:numIterations,4) %[output:group:580436fd] %[output:1c8d7451]
% for i = 1:numIterations
    [im,is] = ind2sub([size(mea_pos,1),size(src_pos,1)],i);

    % % % % source-mea setup
    mesh = mesh_ori; % renew the mesh
    mesh.source.coord = src_pos(is,:);
    mesh.meas.coord = mea_pos(im,:);

    [ind_src,int_func_src] = mytsearchn(mesh,mesh.source.coord);
    mesh.source.int_func = [ind_src int_func_src];
    [ind_mea,int_func_mea] = mytsearchn(mesh,mesh.meas.coord);
    mesh.meas.int_func = [ind_mea int_func_mea];

    % % % % tumour setup

    for k = 1:size_k

        binindex = discretize(tumour_radius(k),radiusEdge);
        % baseline---------------------------------------------
        mesh.mua = mesh_ori.mua; % initialize
        mesh.kappa = mesh_ori.kappa; % initialize
        mesh.mua(find(distance2tumour<=radiusEdge(binindex))) = mua_value + d_mua; % risk here of mua(1)
        mesh.kappa = 1./3*(mesh.mua+mesh.mus); % update the kappa
        fem_result_tumour = femdata_stnd(mesh,0);
        if isnan(fem_result_tumour.amplitude)
            error('no light detected at src[%0.2fmm %0.2fmm],mea[%0.2fmm %0.2fmm]!', ...
                mesh.source.coord(1),mesh.source.coord(2), mesh.meas.coord(1),mesh.meas.coord(2))
        end
        amplitude(i,k) = fem_result_tumour.amplitude;
        % baseline---------------------------------------------

        % pertabution---------------------------------------------
        mesh.mua = mesh_ori.mua; % initialize
        mesh.kappa = mesh_ori.kappa; % initialize
        mesh.mua(find(distance2tumour<=radiusEdge(binindex))) = mua_value + 2*d_mua; % risk here of mua(1)
        mesh.kappa = 1./3*(mesh.mua+mesh.mus); % update the kappa
        fem_result_tumour = femdata_stnd(mesh,0);
        if isnan(fem_result_tumour.amplitude)
            error('no light detected at src[%0.2fmm %0.2fmm],mea[%0.2fmm %0.2fmm]!', ...
                mesh.source.coord(1),mesh.source.coord(2), mesh.meas.coord(1),mesh.meas.coord(2))
        end
        amplitude_p(i,k) = fem_result_tumour.amplitude;
        % pertabution---------------------------------------------


    end

    parfor_progress; % Count progress

end %[output:group:580436fd]
parfor_progress(0); % Clean up progress bar %[output:6b74bbf9]
%%
%[text] ## data post-process and calculate FI
% Convert amplitude to counts per second (cps)
% input_power_density = 3e-3; % maximum safty threshold 3mw/mm^2

input_power_v = [1e-4 5e-4 1e-3 3e-3]; % W/mm^2
% input_power_v = [1e-7 1e-6 1e-5 1e-4]; % W/mm^2
% input_power_v = [1e-10];
Fisher_result_batch = zeros(length(amplitude),length(input_power_v));
PC_batch = zeros(length(amplitude),length(input_power_v));
dIdr_batch = zeros(length(amplitude),length(input_power_v));
ind_result = 1;

for input_power_density =  input_power_v %[output:group:9a70136a]

h = 6.626e-34; % Planck constant in Js
lambda = 800e-9; % wavelength in m
sp_eng = h.*wavelen2freq(lambda); % single photon energy
exposure_time = 0.1;
bandwidth = 1/exposure_time/2;
photon_counts = round(amplitude.*input_power_density/sp_eng*exposure_time*1); % exposure time 0.1s and area 1mm^2
photon_counts_p = round(amplitude_p.*input_power_density/sp_eng*exposure_time*1); % exposure time 0.1s and area 1mm^2

PC_batch(:,ind_result) = photon_counts;

pc_threshold = 1e8*exposure_time; % the threshold of SPAD max cps
dI_dr = (amplitude_p.*input_power_density/sp_eng*exposure_time*1-amplitude.*input_power_density/sp_eng*exposure_time*1)./d_mua; % calculate how the intensity change with tumour mua
dI_dr = dI_dr.*(abs(dI_dr)>1);

dIdr_batch(:,ind_result) = dI_dr;

% % % % distinguish according to threshold
Poisson_ind = photon_counts<=pc_threshold;
Gaussian_ind = photon_counts>pc_threshold;

% % % % gaussian noise level 
nep = 1e-13; % W/sqrt(Hz)
Gaussian_std = nep*sqrt(bandwidth)/sp_eng*exposure_time;
 % std of CPS, exposure time 0.1s

Fisher_result = dI_dr.^2.*1./photon_counts.*Poisson_ind; % Poisson noise
Fisher_result(isnan(Fisher_result)) = 0;
Fisher_result(isinf(Fisher_result)) = 0;

% % % % Gaussian noise+poisson noise
parfor_progress(length(Fisher_result(:))); %[output:425e9b35] %[output:23895e00] %[output:87efc0d4] %[output:159a6f68]
% for i = 1:length(Fisher_result(:))
parfor (i = 1:length(Fisher_result(:)),4) %[output:4d4ea48b] %[output:66af586f] %[output:14ead738] %[output:88d5b4dc]
    if Gaussian_ind(i) == 1
        Fisher_result(i) = calculate_Gau_Pos_FI(Gaussian_std,photon_counts(i),dI_dr(i));
    end
    parfor_progress;
end

parfor_progress(0); %[output:349ce904] %[output:96dcd3bc] %[output:12b1e5a7] %[output:8e5a2d83]
Fisher_result_batch(:,ind_result) = Fisher_result;
ind_result = ind_result+1;
end %[output:group:9a70136a]
%%
%[text] ## show result
figure; %[output:168b6213]
for i = 1:size(Fisher_result_batch,2)
plot((Fisher_result_batch(:,i)),LineWidth=2);hold on %[output:168b6213]
end
xlabel("S-D pair flag") %[output:168b6213]
ylabel('Fisher Information') %[output:168b6213]
ax = gca; ax.FontSize = 20; %[output:168b6213]
title('Fisher Information VS power&S-D pair') %[output:168b6213]

legend_str = '';
for i = 1:length(input_power_v)
    legend_str{end+1} = sprintf('input power = %0.2fmw',input_power_v(i)*1e3);
end

legend(legend_str,'Fontsize',15) %[output:168b6213]
%%
target_sd_pair = 41;
figure; %[output:9b4b90da]
plot_certain_Fisher_setup(circle_mesh,src_pos,mea_pos,tumour_pos,tumour_radius,mua_value,d_mua,target_sd_pair,1) %[output:9b4b90da]
colormap('parula') %[output:9b4b90da]


figure; %[output:174420a8]
subplot(1,3,1) %[output:174420a8]
plot(input_power_v,(PC_batch(target_sd_pair,:)),LineWidth=2); %[output:08344cef]
title('photon counts')
xlabel('input power W/mm^2')
ax = gca; ax.FontSize = 14;

subplot(1,3,2)
plot(input_power_v,dIdr_batch(target_sd_pair,:),LineWidth=2);
title('dI/dr')
xlabel('input power W/mm^2')
ax = gca; ax.FontSize = 14;

subplot(1,3,3)
plot(input_power_v,Fisher_result_batch(target_sd_pair,:),LineWidth=2);
title('FI')
xlabel('input power W/mm^2')
ax = gca; ax.FontSize = 14;

